import { CourseNormalPart, CourseProjectPart, CourseSubmissionPart } from "../types";

const Part = ({ course }: {course: CourseNormalPart | CourseProjectPart | CourseSubmissionPart}) => {
    const typeCourse = course.type;
    switch (typeCourse) {
        case 'normal':
            return <div>
                <p><b>{course.name} {course.exerciseCount}</b><br />
                <i>{course.description}</i></p>
                </div>
            break;
        case 'groupProject':
            return <div>
                <p><b>{course.name} {course.exerciseCount}</b><br />
                project excersices {course.groupProjectCount}</p>
                
            </div>
            break;
        case 'submission':
            return <div>
                <p><b>{course.name} {course.exerciseCount}</b></p>

            </div>
            break;
        default:
            break;
    }
    return <h1>Nan</h1>
}

export default Part;
